import React, { Component } from 'react';
import './form/form.css';

class Form extends Component {
  
  render() { 
    return (
      <div className='box'>
        <form>
          <label>First Name:</label><br />
          <input type='text'/><br />
          <label>Surname:</label>
          <input type='text'/><br />
          <label>Email:</label>
          <input type='email'/><br />
          <label>Phone Number:</label>
          <input type='number'/><br />
          <input className='btn4' type="Submit" />
          </form>
      </div>

      
      
    );
  }
}
 
export default Form;
